import photoProfil from "../images/photoprofil.webp";

import { NavLink } from "react-router-dom";

const Navigation = () => {
  let myNavigation = " col-xl-4 myNavigation text-center p-5 text-light";
  let navItem = "nav-item  ";
  let liItem = document.querySelectorAll("li");

  return (
    <div className={myNavigation}>
      {/* <img scr={photoProfil} alt="photo-profil" /> */}
      <h1>MOUSSA MAHAMOUDd</h1>
      <p>Developpeur Web</p>

      <ul className="nav d-flex flex-column list-group text-light ">
        <NavLink exact to="/" activeClassName="sisi">
          <li className={navItem}>Presentation</li>
        </NavLink>

        <NavLink
          exact
          to="/knowledges"
          className="text-decoration-none text-light display-6"
        >
          <li className="nav-item p-5  " activeClassName="sisi">
            Connaissances
          </li>
        </NavLink>

        <NavLink exact to="/contact">
          <li>Contact</li>
        </NavLink>
      </ul>
    </div>
  );
};

export default Navigation;
